import * as React from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import { BarChart } from '@mui/x-charts/BarChart';
import { useEffect, useState } from "react";
import myApi from "../../Api";
import './Admin.css'
export const Admin = () => {
  const [users, setUsers] = useState([]);
  const [text, setText] = useState("");
  const [counter,setCounter]=useState(null)
  const [counter1,setCounter1]=useState(null)
  const [counter2,setCounter2]=useState(null)
  const [counter3,setCounter3]=useState(null)
  useEffect(() => {
    myApi
      .apiGet()
      .then((data) => {
        setUsers(data);
      })
      .catch((err) => {
        console.error(err);
      });
      
  }, []);


  let count=0
  useEffect(()=>{setCounter(count)
  },[count])
  let count1=0
  useEffect(()=>{setCounter(count1)
  },[count1])
  let count2=0
  useEffect(()=>{setCounter(count2)
  },[count2])
  let count3=0
  useEffect(()=>{setCounter(count3)
  },[count3])
  return (
    <div className='admin'>
    <TableContainer>
    <Table >
    <TableHead>
          <TableRow>
           
            <TableCell >ФИО</TableCell>
            <TableCell >Возраст</TableCell>
            <TableCell >Почта</TableCell>
            <TableCell >Номер телефона</TableCell>
            <TableCell >Место жительства</TableCell>
          </TableRow>
        </TableHead>
        {users.map((u) =>{
          
        if(u.opros=='Из интернета'){
          count+=1;
        }
        if(u.opros=='От знакомых'){
          count1+=1;
        }
        if(u.opros=='Из прессы и ТВ'){
          count2+=1;
        }
        if(u.opros=='Зашли на сайт случайно'){
          count3+=1;
        }
        return(
          <form className='suka' onSubmit={(evt)=>{window.location.reload();setText('');
             return text !=='' && myApi.postEmail({ email: u.email, text: `${text}` })}}
           >
          <TableBody>
              
            <TableRow
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              
              <TableCell >{u.name}</TableCell>
              <TableCell >{u.age}</TableCell>
              <TableCell >{u.email}</TableCell>
              <TableCell >{u.phone}</TableCell>
              <TableCell >{u.location}</TableCell>
              <TableCell ><input onInput={(data)  =>{ setText(data.target.value)}}></input>
            <button className="button"   type="submit">Отправить</button></TableCell>
              <TableCell ><button
              onClick={() => {
                myApi.deleteUser(u.id).then((data) => {
                  setUsers((data) => data.filter((c) => c.id !== u.id));
                });
              }}
            >
              Удалить
            </button></TableCell>
            </TableRow>
          </TableBody></form>
        )})}
        
     <BarChart
  xAxis={[
    {
      id: 'barCategories',
      data: ['Из интернета', 'От знакомых', 'Из прессы и ТВ','Случайно зашли на сайт'],
      scaleType: 'band',
    },
  ]}
  series={[
    {
      data: [count, count1, count2, count3],
    },
  ]}
  width={800}
  height={300}
/>
     
    </Table>
    </TableContainer>
    
    </div>
  );
};
